import React, { Component } from 'react';
import './App.css';
import LayoutContainer from './container/index'
class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      type: ["date", "text"],
      invoice: ["invoice1", "invoice2", "invoice3"],
      currency: ["USD", "EURO", "INR"],
      freight: ["FOB1", "FOB2", "FOB3"],
      shippingMethods: ["AirBorne", "Ship", "Train"],
      country: ["india", "USA", "NewZealand"]
    }
  }

  render() {
    return (
      <div className="App">
        <LayoutContainer />
      </div>
    );
  }
}

export default App;
